import React from 'react';
import {Row, Col} from 'antd';
import {Center} from "../hoc/Center";


function Game() {
    return (
        <>
            <Center span={15}>
                <Row>
                    <Col span={8} onMouseEnter={() => console.log('1')} className='cell'>col-8</Col>
                    <Col span={8} onMouseEnter={() => console.log('2')}>col-8</Col>
                    <Col span={8} onMouseEnter={() => console.log('3')}>col-8</Col>
                </Row>
                <Row>
                    <Col span={8} onMouseEnter={() => console.log('4')}>col-8</Col>
                    <Col span={8} onMouseEnter={() => console.log('5')}>col-8</Col>
                    <Col span={8} onMouseEnter={() => console.log('5')}>col-8</Col>
                </Row>
                <Row>
                    <Col span={8} onMouseEnter={() => console.log('7')}>col-8</Col>
                    <Col span={8} onMouseEnter={() => console.log('8')}>col-8</Col>
                    <Col span={8} onMouseEnter={() => console.log('9')}>col-8</Col>
                </Row>
            </Center>
        </>
    );
}

export default Game;
